  03> WILSON, Jessica Mary and MILLER, Norman Michael
  b 20.10.1957
  b 06.05.1961
  Jessica b. at Sheffield, England. Address: 23 Grassmount, Taymount Rise,
  Forest Hill, London SE23 3UW, England.
  Jessica was educated at Marsden School, Wellington High School and
  Victoria University, graduating Bachelor of Music in 1978. She completed a
  years post-graduate study at Auckland Teachers' College and taught music
  at Epsom Girls' Grammar School for several years before travelling to
  London where she now lives. She has been the Director of Music Programmes at the Islington
  Community Arts Centre, and currently teaches music part-time at Thomas Tallis School in Blackheath.
  Norman works in television and is also a free-lance journalist, contributing articles regularly to
  the British press.
  01> MILLER, Freya Beth
  b 01.09.1993
  04> WILSON, Marianne Rachel m on 16.12.1989 to CLEVERLEY, Barthold
  b 16.05.1959
  b 18.07.1962
  Marianne b. at Wanganui and m. at Papakura. Barthold b, at Christchurch. Address: 11 Westmere Park
  Avenue, Westmere, Auckland.
  Marianne moved with her family to Wellington in 1962 where she attended Marsden Collegiate School
  (1964-75), Hutt Valley High School (1976-77) and Victoria University (1978-80) majoring in Music
  history and analysis. Moving to Auckland University in 1981, she completed her BA with studies in
  English Literature. See photo page 224.
  In 1980-81 Marianne also worked as a community worker with the Mount Eden Borough Council. From
  1982 to 1985 she was overseas, living in Sydney, London and New York and travelling extensively in
  Europe and South America. On her return she co-managed a restaurant/ bar in Auckland, then in 1987
  she attended the Auckland College of Education, training as a secondary school teacher. She was
  Head of the Music Department at Green Bay High School (1988-92).
  Barthold attended primary and secondary schools in Auckland and played under-16 soccer for
  Auckland. He studied for Bachelor of Commerce at University of Canterbury (1980-81) and at Auckland
  University (1986-87). In the interim he travelled extensively through Asia, Europe and North and
  South America. He is currently employed as an accountant with an Auckland accountancy practice. He
  was a nationally ranked tennis player.
